import React, { Fragment } from 'react';
import { Route, Link } from 'react-router-dom';
import { Home } from './components/Home'

// How do we get the match object here?
function App(props) {
  console.log(props);

  return (
    <Fragment>
      <img/>
      <div className="character-info-wrapper">


        <nav>

          <Link co to={`/`}>Home</Link>
        </nav>


      </div>
    </Fragment>
  );
}




export default App;
